import React, {Component} from 'react';
class Menubar extends Component{
    render(){
      return(
        
<ul class="nav nav-pills nav-fill">
  <li class="nav-item">
    <a class="nav-link active" href="#">메뉴</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">동아리 보기</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">동아리 신청</a>
  </li>
  <li class="nav-item">
    <a class="nav-link text-black" href="#">마이 페이지</a>
  </li>
</ul>
      );
    }
  }
export default Menubar;
